import logo from "./logo.svg";
import "./App.css";
import { API } from "./API.js";
import { useState } from "react";

function App() {
  const [search, setSearch] = useState("");
  return (
    <div className="App">
      <header className="App-header">
        {/* Header */}
        <h1>Weather</h1>
        <input
          type="text"
          placeholder="Поиск"
          onChange={(e) => setSearch(e.target.value)}
        />
        <button>Поиск</button>

        {/* Location */}
        <p>Moscow, Russian Federation</p>
        {/* Temperature */}
        <p>32°C</p>
        {/* Condition */}
        <p>Sunny</p>
      </header>
    </div>
  );
}

export default App;
